import React, { Component } from 'react'

class Match extends Component {

    render (){
        const establishmentName = this.props.establishments.find(e => e.id == this.props.est_id)
        return(
            <div>
                {establishmentName} - {this.props.when}
            </div>
        )
    }
}

export default Match
